import { Component, Host, h } from "@stencil/core";
/** @internal */
export class NeftifyButton {
  render() {
    return (h(Host, null,
      h("button", null,
        h("slot", null))));
  }
  static get is() { return "neftify-button"; }
  static get encapsulation() { return "shadow"; }
  static get originalStyleUrls() { return {
    "$": ["neftify-button.scss"]
  }; }
  static get styleUrls() { return {
    "$": ["neftify-button.css"]
  }; }
}
